import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import Bags from "./components/"

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />

        {/* Accessories categories */}
        <Route path="/accessories/watches" element={<Watches />} />
        <Route path="/accessories/wallets" element={<Wallets />} />
        <Route path="/accessories/bags" element={<Bags />} />
        <Route path="/accessories/sunglasses" element={<Sunglasses />} />
        <Route path="/accessories/hats" element={<Hats />} />
        <Route path="/accessories/belts" element={<Belts />} />
      </Routes>
    </Router>
  );
}

export default App;
